import { Routes, Route } from 'react-router-dom';
import Portfolio from './components/Portfolio';
import ContentCarousel from './components/ContentCarousel';
import { CiMenuFries } from 'react-icons/ci';
import IconsList from './components/IconsList';
import './app.css';
import MyNavbar from './components/MyNavbar';

export default function App() {
   return (
      <main className='App'>
         {/* <h2 className='logo-name text-center text-white'>Field Palmer</h2> */}
         {/* <div className='menu-nav'> */}
         {/* <h2 className='menu-logo text-white'> */}
         {/* <CiMenuFries /> */}
         {/* </h2> */}
         {/* </div> */}
         <section className='container p-sm-2 p-md-5'>
            <MyNavbar />
            <Routes>
               <Route path='/' element={<ContentCarousel />} />
               <Route path='/portfolio' element={<Portfolio />} />
            </Routes>
         </section>
         <IconsList className='icon-footer' />
      </main>
   );
}
